import React from 'react';
import LoginForm from '../components/Authentication/LoginForm';

const LoginPage = () => {
    return (
        <div style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            backgroundColor: '#f0f2f5'
        }}>
            <LoginForm />
        </div>
    );
};

export default LoginPage;
